import './App.css';
import ReactPlayer from 'react-player';
const url = 'http://192.168.1.61:8080/stream?topic=/argus/ar0234_front_left/scaled/image_raw';

const options = {
  requestHeader: 'Authorization',
  requestToken: 'access_token'
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ReactPlayer
            className='video-class'
            controls={true}
            autoPlay={true}
            options={options}
            remoteUrl={url}
          />
        <br></br>
        <br></br>
        <br></br>
        <table className="buttons">
          <tr>
            <td><button type="button" className="btn">ON</button></td>
            <td><button type="button" className="btn">OFF</button></td>
          </tr>
        </table>
      </header>
    </div>
  );
}

export default App;
